DROP TABLE run_data;
DROP TABLE run_data_seq;
CREATE DATABASE running;
USE running;

-- DESCRIBE run_data;

SELECT * FROM run_data;

CREATE TABLE run_data 
(
    id	BIGINT AUTO_INCREMENT NOT NULL,
    weekday			VARCHAR(255),
    month		VARCHAR(255),
    dom			INT,
    year		VARCHAR(255),
    avg_pace	VARCHAR(255),
    distance	DECIMAL(4,2),
    duration	TIME,
    calories	INT,
    PRIMARY KEY (id)
);

